import React from "react";
import "./App.css";

function Boost({count}) {
  return (
    <div className="Boost">
      <h2 className="title">Boost</h2>
      <p className="count-click">{count}</p>
      <div className="catalog">
        <div className="card">
          <div className="card-text">
            <b>factory</b>
          </div>

          <hr className="card-hr"/>
        </div>
      </div>
    </div>
  );
}
export default Boost;
